def display_screen(content):
    for line in content:
        print("".join(line))

def insert_text(text, content, coord):
    updated_content, updated_text, x, y = content.copy(), list(text), coord[0], coord[1]
    del updated_content[y][x:len(updated_text)]
    
    current_x = x
    for char in updated_text:
        try:
            updated_content[y].insert(current_x, char)
            current_x += 1
        except IndexError:
            print("Inserted text too large for UI!")
            return content
        
    return updated_content